import React, { Component } from 'react';

import shareScreen from "../../pictures/sharescreen.png";

import optimizeVideo from "../../pictures/optimizevideo.png";
import allEars from "../../pictures/allears.png";
import pause from "../../pictures/pause.png";


import axios from 'axios';


class Page5 extends Component {

    state = {
        text: {}
    }
    handleScroll=()=>{
        window.scroll({top:0,behavior:'smooth'})
    
    }
    componentDidMount() {
        this.handleScroll()
        axios.get("http://localhost:3001/texts")
        .then(res => {
            const texts = res.data;
            for (const txt of texts){
                if (txt.sheet === "9"){
                    this.setState({
                        text: {...this.state.text, [txt.id_tag]: txt}
                    })
                }
            }
              
    })
}

    handleChange = (event) => {
        this.setState({text: {...this.state.text, [event.target.id]: {value: event.target.value, id_tag: event.target.id}}})
        if (event.target.id in this.state.text){
            axios.patch(`http://localhost:3001/texts/${this.state.text[event.target.id].id}`, {value: event.target.value, id_tag: event.target.id, sheet: "9"})
    }
        else {
            axios.post("http://localhost:3001/texts", {value: event.target.value, id_tag: event.target.id, sheet: "9" })
        }
    }

    getValue = (id) => {
        for (const i in this.state.text){
            if (this.state.text[i].id_tag === id){
                return this.state.text[i].value;
            }
        }
        return ""
    }
  
    render() {
        return (
            <div className="sheet">
                <h1 id="p4title" className="bold center">Anxiety</h1>
                <div id="page5" className="left">

                    <h2>During our time together, we are going to be learning a lot about mental health and how to keep your symptoms from getting in the way of things you want to do! Remember, you are not alone in feeling this way â€“ there are a lot of young adults, including me, who are going through similar things as you. </h2>
                    <br /><br />
                    <h2>Now we will watch a video to learn more about symptoms.</h2>
                    <br /><br />
                    <a href="https://drive.google.com/file/d/1cxN_Bzo3uN-Mkt6nL29vEMUJTXLB7tPk/view?usp=sharing">Video link</a>
                    <br /> <br /><br />
                    <div id="inst_3_5" className="custom_svg demo_box">
                        <h2 className="in_inst"> Share your screen </h2>
                        <br/><br/>
                        <h2 className="in_inst"> -Share sound</h2>
                        <br/><br/>
                        <h2 className="in_inst"> -Optimize for video</h2>
                    </div>
                    <img src={shareScreen} alt="Share screen" id="shareScreen2_5" />
                    
                    <img src={optimizeVideo} alt="Optimize video" id="optimizeVideo5" />
                    
                    <br/><br/><br/><br/><br/><br/><br/><br/><br/>
                    <h2>In the video, they talked about there being things that make symptoms worse. Some things that make my symptoms worse are:</h2>
                    <br/><br/>
                    <div id="np_1_5">
                        <textarea onChange={event => this.handleChange(event)} id="nt_1_5" defaultValue={this.getValue("nt_1_5")} />
                    </div>
                    <br/><br/>
                    <h2>What about you? What makes your symptoms worse?</h2>
                    <img src={allEars} alt="All ears" className="allEars" />
                    <img src={pause} alt="Pause" className="pause" />
                </div>   
            </div>
        )
    }


}
export default Page5;

